import axios from 'axios';
 
 class TimetableService {
 
 deleteTimetable(id) {
 axios.dlete('http://localhost:8070/timetables/deleteTimetable' + id)
 .then(() => {
 console.log('timetable Deleted !!!')
 })
 .catch((error) => {
 console.log(error)
 })
 }
 }
 
 export default TimetableService;
